import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';


const Nav = () => {
    const counter = useSelector(state => state.counter);
    const user = useSelector(state => state.who);
    const clicks = useSelector(state => state.clicks);
    return(

        <div className="nav">
            <div className="nav-container">
                {/* <div className="hi">Hello {user}!
                {user !== "guest" ? <p>Wow, Love your name!</p> : <p>I guess we can stay friends.</p>}
                </div> */}
                {/* <p>Counter: {counter}</p>
                <p>You've clicked {clicks} times on this website</p> */}
                <Link to="/">LEIF</Link>
                <Link to="/school"> <button>SCHOOL</button> </Link>
                <Link to="/jobs"> <button>WORK</button> </Link>
                <Link to="/passions"> <button>PASSION</button></Link>
                <Link to="/redux"> <button>PLAY ZONE</button> </Link>
                {user!== 'guest' ? <Link to="/name"><button>NICE NAME</button></Link> : null }
            </div>

        </div>
    )
}

export default Nav;
